import React from 'react';

function Services() {
  return (
    <div>
      <h1>Our Services</h1>
      <ul>
        <li>SEO Optimization</li>
        <li>Content Marketing</li>
        <li>Social Media Management</li>
        <li>Pay-Per-Click Advertising</li>
      </ul>
    </div>
  );
}

export default Services;
